('Video', 43, 'Ebenezer Kepombia', '2024-04-16 18:54:20.117628', 'Foyer polygamique (Les dballeurs) saison 2 film africain est une srie dramatique camerounaise qui suit les histoires de plusieurs familles de Douala et leurs aventures rocambolesques. Mitoumba est mari depuis plusieurs annes  Mado, mais lenfant ne vient pas. Il dcide de lui prendre une copouse. Ptrol est le successeur dune famille dont les copouses se dchirent Ralis par Ebenezer Kepombia', 'jeu_des_4_verite.jpeg', 'Foyer Polygamique', 'jeu_des_4_verite.jpeg', 'polygamie.jpeg', 5000.00, 10051, '2024-05-10 07:12:26.468158', 560.00, NULL, NULL, NULL, NULL, 12, NULL),
('Video', 44, 'Ebenezer Kepombia', '2024-04-16 18:55:32.934557', 'Foyer polygamique (Les dballeurs) saison 1 film africain est une srie dramatique camerounaise qui suit les histoires de plusieurs familles de Douala et leurs aventures rocambolesques. Mitoumba est mari depuis plusieurs annes  Mado, mais lenfant ne vient pas. Il dcide de lui prendre une copouse. Ptrol est le successeur dune famille dont les copouses se dchirent Ralis par Ebenezer Kepombia', 'jeu_des_4_verite.jpeg', 'Les debaileurs', 'jeu_des_4_verite.jpeg', 'debailleur.jpeg', 5000.00, 10051, '2024-05-10 07:08:32.133330', 560.00, NULL, NULL, NULL, NULL, 12, NULL),
('Video', 45, 'Ebenezer Kepombia', '2024-04-16 18:56:55.959430', 'Produit par lacteur camerounais Ebenezer Kepombia, ce show africain aborde tous les problmes auxquels sont confronts les couples aprs le mariage. Les pisodes vous offriront certainement des retournements de situations inattendus !', 'jeu_des_4_verite.jpeg', 'Cercle vicieux', 'jeu_des_4_verite.jpeg', 'vicieu.jpeg', 5000.00, 10051, '2024-05-10 07:06:46.446386', 560.00, NULL, NULL, NULL, NULL, 12, NULL),
('Video', 46, 'Jean de Dieu tchenebe', '2024-04-16 18:58:32.690756', 'Samba le gnral le film est un feuilleton qui aborde les thmatiques tels que labus de pouvoir, la corruption, le trafic dinfluence, la promotion de la mdiocrit au dtriment du mrite qui svissent dans nos socits modernes africaines. Par ailleurs, les violences physiques ou morales faites aux femmes, le pouvoir  tout prix et  tous les prix restent dactualit. On ouvre le dbat sur le rle de la femme au foyer, limportance du mariage dans les socits africaines etc cest lhistoire dun gnral dun pays de lAfrique subsaharienne qui tyrannise son entourage dans le but davoir plein de pourvoir et le contrle sur les personnes et les biens. Une production MNL', 'jeu_des_4_verite.jpeg', 'General Samba', 'jeu_des_4_verite.jpeg', 'samba2.jpg', 3500.00, 10051, '2024-05-10 06:59:55.541536', 420.00, NULL, NULL, NULL, NULL, 12, NULL),
('Video', 47, 'Jean de DIeu Tchenebe', '2024-04-16 18:59:43.493044', 'Met en exegre l\'application de la lois au cameroun.  Voici la seule srie judiciaire africaine.', 'jeu_des_4_verite.jpeg', 'Proces', 'jeu_des_4_verite.jpeg', 'proces.jpeg', 5000.00, 10051, '2024-05-10 07:23:02.423519', 460.00, NULL, NULL, NULL, NULL, 12, NULL),
('Video', 48, 'Thierry Ntamack', '2024-04-16 19:01:41.681410', 'La jeune Eyenga est une Camerounaise issue d\'une famille pauvre du quartier Mboamanga,  Kribi. Comme beaucoup de jeunes filles de son poque, elle se rend dans un cybercaf avec pour seul but de se trouver un Blanc qui deviendra son poux. Encourag par Molla, le propritaire du cybercaf, la jeune fille russit  trouver  son blanc  dnomm Jean-Franois Dupont sur Internet. Ce dernier ne tarde pas  programmer son voyage pour le Cameroun, et pouser Eyenga sur le champ ds son arrive. Le problme, M. Dupont n\'a pas en projet d\'amener Eyenga en France comme celle-ci le souhaite2.', 'jeu_des_4_verite.jpeg', 'Le Blanc d\'Eyenga', 'jeu_des_4_verite.jpeg', 'affiche-le-blanc-d-eyenga-thierry-ntamack-lefilmcamerounais-1.webp', 3500.00, 10051, '2024-05-10 07:25:24.182538', 320.00, NULL, NULL, NULL, NULL, 11, NULL),
('Video', 49, 'Jean Pierre bekolo', '2024-04-16 19:03:20.333131', 'Une jeune fille curieuse, appele Chef de quartier, souhaite connatre la vie de ce quartier de Yaound. Une femme sorcire la transforme en jeune homme. Sintgrant dans le quartier comme un homme, elle en dcouvre les murs souvent machistes. Les jeunes du coin la poussent  draguer sans tergiverser Samedi, la fille de Chien Mchant, le policier du quartier, et attendent de savoir sil va la  grer .  Une intrigue secondaire tourne autour de la famille de Chient Mchant : aprs avoir engag comme gardien Panka, qui semble avoir le pouvoir de faire disparatre le sexe des hommes en leur serrant la main, il ramne une deuxime femme  la maison, et tente de la faire accepter  sa famille. Il finit par chasser sa premire femme, en sollicitant le chef et son oncle. Il devra forcer ses enfants  s\'adresser  la deuxime pouse pour demander de largent, et  manger sa cuisine.', 'jeu_des_4_verite.jpeg', 'Quartier Mozart', 'jeu_des_4_verite.jpeg', 'mozard.jpeg', 3000.00, 10051, '2024-05-10 07:27:39.788585', 420.00, NULL, NULL, NULL, NULL, 11, NULL),
('Video', 50, 'Jean-Pierre Dikongu Pipa', '2024-04-16 19:04:43.682586', 'Ngando, un jeune villageois, aime Ndom  laquelle il est fianc. Le mariage est impossible car il ne peut runir la dot. Il sollicite son riche oncle mais celui-ci convoite Ndom pour en faire sa cinquime pouse car aucune ne lui a donn un enfant.', 'jeu_des_4_verite.jpeg', 'Muna moto', 'jeu_des_4_verite.jpeg', 'munamoto.jpeg', 5000.00, 10051, '2024-05-10 07:29:13.257267', 360.00, NULL, NULL, NULL, NULL, 11, NULL),
('Video', 51, 'Frank Thierry Lea Malle', '2024-04-16 19:06:19.786863', 'LAccord retrace lhistoire de Flora, une jeune fille de quartier dfavoris, retrouve drogue et viole lors dune fte organise par son petit ami Cdric, qui vit dans un quartier rsidentiel. Pour viter un scandale, les parents de Cdric proposent aux parents de Flora une forte somme dargent contre un accord de confidentialit. Alors que vont dcider les parents ? Faire clater la vrit ou sortir de la misre ?', 'jeu_des_4_verite.jpeg', 'L\'accord', 'jeu_des_4_verite.jpeg', 'accord.jpeg', 3500.00, 10051, '2024-05-10 07:34:36.186741', 360.00, NULL, NULL, NULL, NULL, 11, NULL),
('Video', 52, ' Dr Nkeng Stephens', '2024-04-16 19:07:51.134152', 'L\'Axe Lourd est un film d\'action futuriste. C\'est le premier long mtrage ralis par Nkeng Stephens. Le film a t crit par Duala Duala et Bidbilla Peter Nwanyama et produit par Transparent Studios. En 2035 Le Njuana, un pays imaginaire d\'Afrique de l\'ouest o une pierre de rubis unique en son genre resurgit une dcennie plus tard aprs avoir t dclare disparue. Un gang dtermin  s\'en prendre  un convoi militaire dans le but de lui drober cette pierre prcieuse aux multiples superpouvoirs dont celui de restaurer la vie fait face  Elijah et ses trois acolytes qui se dressent en vritables adversaires. Commence alors une histoire de cupidit, de trahison, de choix difficiles, de fureur et de rdemption.', 'jeu_des_4_verite.jpeg', 'L\'axe lourd', 'jeu_des_4_verite.jpeg', 'axe.jpeg', 6000.00, 10051, '2024-05-10 07:40:08.719615', 450.00, NULL, NULL, NULL, NULL, 11, NULL),
